import React, { useState } from "react";
import Game from "./Game";

const Square = ({ value, onClick }) => {
  const [xIsNext, setXIsNext] = useState(true);

  const handleClick = () => {
    setXIsNext(!xIsNext);
  };
  return (
    <button
      className={"square " + (xIsNext ? "jedi" : "empire")}
      onClick={handleClick}
    >
      {value}
    </button>
  );
};

export default Square;
